import React from "react";
import Navbar from "./components/Navbar";
export default () => {
  return (
    <div>
      <Navbar />
      <link
        rel="icon"
        href="https://file-link.s3.us-east-2.amazonaws.com/logo.png"
      />
      <h1>Click me</h1>
      <button onClick={() => console.log("hello")}>Click me</button>
    </div>
  );
};
